function Dashboard() {
  return (
    <div className="Dashboard">
      <section className="tabs">
        <ul>
          <li>Your Trackings</li>
          <li>Search Crops</li>
          <li>Predict Production</li>
        </ul>
      </section>
      <section className="right"></section>
    </div>
  );
}

export default Dashboard;
